import React from 'react';
import {Container, Row, Col } from 'react-bootstrap';
import 'bootstrap/dist/css/bootstrap.min.css';
import {FaqSection,
    FaqAccordianWrapper,
    AccordianSectionHeading} from './faq.style'
import AccordianCustom from './AccordianCustom';

import { FAQ } from '../../../pagedata/FaqPage';


const FaqPage =()=>{
    return (
        <FaqSection>
            <Container>
                <FaqAccordianWrapper>
                    <Row>
                        <Col md="12">
                        <AccordianSectionHeading>{FAQ.FaqSectionSubHeading1}</AccordianSectionHeading>
                        {
                            FAQ.AccordianCustom1.map((item,idx) => {
                            return <AccordianCustom 
                                title={item.title}
                                description= {item.description} 
                            />
                            })
                        }
                        </Col>
                    </Row>
                    <Row>
                        <Col md="12">
                        <AccordianSectionHeading>{FAQ.FaqSectionSubHeading2}</AccordianSectionHeading>
                        {
                            FAQ.AccordianCustom2.map((item,idx) => {
                            return <AccordianCustom 
                                title={item.title}
                                description= {item.description} 
                            />
                            })
                        }
                        </Col>
                    </Row>
                    <Row>
                        <Col md="12">
                        <AccordianSectionHeading>{FAQ.FaqSectionSubHeading3}</AccordianSectionHeading>
                        {
                            FAQ.AccordianCustom3.map((item,idx) => {
                            return <AccordianCustom 
                                title={item.title}
                                description= {item.description} 
                            />
                            })
                        }
                        </Col>
                    </Row>
                </FaqAccordianWrapper>
            </Container>
        </FaqSection>
    );
}
export default FaqPage;
